import axios from 'axios';

const getMatches = (callback) => {
    axios.get('http://localhost:23204/api/match/get',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
            }
        }
    ).then((res) => {
        callback(res.data);
    })
}

export {
    getMatches
}
